import React, { useContext, useState } from 'react';
import { InventoryContext } from '../context/InventoryContext';
import '../styles.css'; 

const ProductManagement = () => {
  const { products, addProduct, updateProduct, deleteProduct } = useContext(InventoryContext);
  const [newProduct, setNewProduct] = useState({
    id: '', // For tracking which product is being updated
    name: '',
    description: '',
    category: '',
    price: 0,
    quantity: 0,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setNewProduct(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (newProduct.id) {
      // Update existing product
      updateProduct(newProduct.id, newProduct);
    } else {
      // Add new product
      const productId = new Date().getTime().toString(); // Unique ID based on timestamp
      addProduct({ id: productId, ...newProduct });
    }
    setNewProduct({ id: '', name: '', description: '', category: '', price: 0, quantity: 0 }); // Reset form
  };

  const handleEdit = (product) => {
    // Load the selected product into the form for editing
    setNewProduct(product);
  };

  const handleDelete = (id) => {
    deleteProduct(id);
  };

  return (
    <div>
      <h1>Product Management</h1>
      <form onSubmit={handleSubmit}>
        <input 
          type="text" 
          name="name" 
          value={newProduct.name} 
          onChange={handleChange} 
          placeholder="Product Name" 
          required 
        />
        <input 
          type="text" 
          name="description" 
          value={newProduct.description} 
          onChange={handleChange} 
          placeholder="Description" 
          required 
        />
        <input 
          type="text" 
          name="category" 
          value={newProduct.category} 
          onChange={handleChange} 
          placeholder="Category" 
          required 
        />
        <input 
          type="number" 
          name="price" 
          value={newProduct.price} 
          onChange={handleChange} 
          placeholder="Price" 
          required 
        />
        <input 
          type="number" 
          name="quantity" 
          value={newProduct.quantity} 
          onChange={handleChange} 
          placeholder="Initial Quantity" 
          required 
        />
        <button type="submit">{newProduct.id ? 'Update Product' : 'Add Product'}</button>
      </form>

      {/* Product Table */}
      <h2>Products</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Category</th>
            <th>Price</th>
            <th>Initial Quantity</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map(product => (
            <tr key={product.id}>
              <td>{product.name}</td>
              <td>{product.description}</td>
              <td>{product.category}</td>
              <td>M{product.price}</td>
              <td>{product.quantity}</td>
              <td>
                <button onClick={() => handleEdit(product)}>Edit</button>
                <button onClick={() => handleDelete(product.id)}>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductManagement;
